    def test_xspec_data_retriever_value_exception(self):
        mass = 1*10**6
        dist = 74
        logmdot = -1.7
        astar = 0.4
        cosi = math.cos(math.radians(11))
        redshift = 0.03
        rmf = "build/"+self.spectra_generator.rmf_list[1]
        arf = "build/"+ 'rmf_arf/' + self.spectra_generator.arf_list[5] + '/' + self.spectra_generator.arf_list[5] + 'pc.arf'
        nSpectra = 1
        exposure_time = 15000
        counter = 1
        with self.assertRaises(ValueError) as exception_context:
            actual = self.spectra_generator._generator__xspec_data_retriever(mass, dist, logmdot, astar, cosi, redshift,nSpectra, rmf, arf, exposure_time, counter)
        self.assertEqual(str(exception_context.exception),"Parameters are out of defined bounds!")
        
